import Img3 from './Img3.jpg'; 
import { Container } from 'react-bootstrap';

function SqrBox() {
    return (
      <Container fluid style={{position: "relative"}}>
        <div style={{}}>
          <Row>
            <Col>
            </Col>
          </Row>
        </div>
      </Container>
    );
  } 

